description:
Pride and Glory is Zakk Wylde's (Ozzy Osbourne Life Guitarist, Black Label Society Front Man) first self-fronted album. It has more of a Southern rock sound than Zakk Wylde's other albums incorporating the likes of banjo, harmonica and mandolin.

